import React from 'react';
import ReactDOM from 'react-dom';

let today=new Date();  


ReactDOM.render(
  <React.Fragment>
     <h1>This is Gaurav Singh</h1>
     <h3>Today date is {today} </h3>
  </React.Fragment>,
  document.getElementById('root')
);
